#include<stdio.h>
#include<stdlib.h>

struct list
{
    int data;
    struct list *rlink;
    struct list *llink;
};

struct list *tail=NULL;

struct list *creation(struct list *head)
{
    struct list *temp,*naya;    int item;
    naya=(struct list *)malloc(sizeof(struct list));
    if (naya!=NULL)
    {
        printf("Enter item : ");    scanf("%d",&item);
        naya->data=item;    naya->rlink=NULL;   naya->llink=NULL;
        if (head==NULL)
        {
            head=naya;
            tail=naya;
        }
        else
        {
            temp=head;
            while (temp->rlink!=NULL)
            {
                temp=temp->rlink;
            }
            temp->rlink=naya;
            naya->llink=temp;
            tail=naya;
        }
    }
    else
        printf("\nNo memory\n");
    return head;
}

void traverse(struct list *head)
{
    struct list *temp;
    temp=head;
    if(head!=NULL)
    {
        printf("\nList is :\t");
        while (temp!=NULL)
        {
            printf("%d\t",temp->data);
            temp=temp->rlink;
        }
    }
    else
        printf("\nNo list exist\n");
}

struct list *insert_first(struct list *head)
{
    struct list *temp,*naya;    int item;
    naya=(struct list *)malloc(sizeof(struct list));
    if(naya!=NULL)
    {
        printf("Enter item : ");    scanf("%d",&item);
        naya->data=item;    naya->rlink=NULL;   naya->llink=NULL;
        temp=head;
        head=naya;
        naya->rlink=temp;
    }
    else
        printf("\nNo memory");
}

struct list *insert_last(struct list *head)
{
    struct list *temp,*naya;    int item;
    naya=(struct list*)malloc(sizeof(struct list));
    if(naya!=NULL)
    {
        printf("Enter item : ");    scanf("%d",&item);
        naya->data=item;    naya->rlink=NULL;   naya->llink=NULL;
        temp=head;
        while (temp->rlink!=NULL)
        {
            temp=temp->rlink;
        }
        temp->rlink=naya;
        naya->llink=temp;
        tail=naya;
    }
}

struct list *delet_first(struct list *head)
{
    
}

struct list *delet_last(struct list *head)
{
    
}




void main()
{
    struct list *head=NULL;
    int choice,item;
    while(1)
    {
        printf("\n\n1: Creation\n2: Traverse\n3: insert_first\n4: insert_last\n5: del_first\n6: del_last\n7: exit\n\n");     scanf("%d",&choice);
        switch (choice)
        {
             case 1 : head=creation(head);      break;
             case 2 : traverse(head);           break;
             case 3 : head=insert_first(head);  break;
             case 4 : head=insert_last(head);   break;
             case 5 : head=delet_first(head);   break;
             case 6 : head=delet_last(head);    break;
             case 7 : goto exit;
             default : printf("\nenter a valid choice\n");
        }
    }
    exit:
    printf("\nout of loop\n");
}

