#define size 5
#include<stdio.h>
#include<stdlib.h>

struct stack
{
	int top;
	int ar[20];
};

struct stack stk;

void display()
{
	int i;
	printf("\nStack is : \n");
	for(i=stk.top;i>=0;i--)
	{
		printf("%d\n",stk.ar[i]);
	}
}

void push()
{
	int item;
	if(stk.top<size-1)
	{
		printf("Enter element : ");
		scanf("%d",&item);
		stk.top++;
		stk.ar[stk.top]=item;
	}
	else
		printf("\nOverflow\n");
	display();
}

void pop()
{
	int item;
	if(stk.top==-1)
		printf("\nUnderflow\n");
	else
	{
		item=stk.ar[stk.top];
		stk.top--;
		printf("\npopped item is : %d\n",item);
	}
}

int main()
{
	int choice;
	stk.top=-1;
	while(1)
	{
		printf("\n1: Push\n2: Pop\n3: display\n4: exit\n");
		scanf("%d",&choice);
		switch(choice)
		{
			case 1 : push(); 							break;
			case 2 : pop();								break;
			case 3 : display();							break;
			case 4 : goto exit;
			default: printf("Enter a valid choice\n");
		}
	}
	exit:
	printf("Hey! buddy , I'm out of loop\n");
}

