entity demultiplexer is
    Port ( s : in  STD_LOGIC_VECTOR (2 downto 0);
           y : out  STD_LOGIC_VECTOR (7 downto 0);
           i : in  STD_LOGIC);
end demultiplexer;

architecture Behavioral of demultiplexer is

begin

y <=(i & "0000000") when(s="000") else

	("0" & i & "000000") when(s="001") else
	("00" & i & "00000") when(s="010") else
	("000" & i & "0000") when(s="011") else
	("0000" & i & "000") when(s="100") else
	("00000" & i & "00") when(s="101") else
	("000000" & i & '0') when(s="110") else
	("0000000" & i);
end Behavioral;



