/* START OF BUBBLE SORT*/

void bubbleSort(int ar[], int size)
{
    int i, j, temp;
    for (i = 0; i < size; i++)
    {
        for (j = 0; j < size - 1 - i; j++)
        {
            if (ar[j] > ar[j + 1])
            {
                // printf("\n swapping %d< %d", ar[i], ar[j]);
                temp = ar[i];
                ar[i] = ar[j];
                ar[j] = temp;
            }
        }
    }
}

/* END OF BUBBLE SORT */

/* START OF SELECTION SORT */

void selectionSort(int ar[], int size)
{
    int i, j, k, min, temp;

    for (i = 0; i < size; i++)
    {
        for (j = i; j < size; j++)
        {
            min = j;
            for (k = j; k < size; k++)
            {
                if (ar[k] < ar[min])
                {
                    min = k;
                }
            }
            temp = ar[j];
            ar[j] = ar[min];
            ar[min] = temp;
        }
    }
}

/* END OF SELECTION SORT */

/* START OF INSERTION SORT */

void insertionSort(int ar[], int size)
{
    int i, j, temp, item;

    for (i = 1; i < size; i++)
    {
        item = ar[i];
        j = i - 1;
        while (j >= 0 && item < ar[j])
        {
            ar[j + 1] = ar[j];
            j--;
        }
        ar[j + 1] = item;
    }
}

/*END OF INSERTION SORT*/

/* START OF MERGE SORT*/

void mergeSort(int ar[], int low, int mid, int high)
{
    int i = low, j = mid + 1, k = 0, ar2[high - low + 1];

    while (i <= mid || j <= high)
    {
        if (i <= mid && (ar[i] < ar[j] || j > high))
            ar2[k++] = ar[i++];
        else
            ar2[k++] = ar[j++];
    }
    for (i = low; i <= high; i++)
        ar[i] = ar2[i - low];
}
void merge(int ar[], int low, int high)
{
    if (low >= high)
        return;
    int mid = (low + high) / 2;
    merge(ar, low, mid);
    merge(ar, mid + 1, high);
    mergeSort(ar, low, mid, high);
}

/** END OF MERGE*/

/** START OF QUICK SORT */

// ma'am algo
int partition(int ar[], int low, int high)
{
    int i = low, j = high, pivot = low, temp;
    while (1)
    {
        while (ar[pivot] < ar[j] && j != pivot)
        {
            j--;
        }
        if (j == pivot)
            return pivot;
        if (ar[pivot] > ar[j])
        {
            temp = ar[j];
            ar[j] = ar[pivot];
            ar[pivot] = temp;

            i = pivot;
            pivot = j;
        }

        while (ar[pivot] > ar[i] && pivot != i)
            i++;
        if (i == pivot)
            return pivot;

        if (ar[pivot] < ar[i])
        {
            temp = ar[pivot];
            ar[pivot] = ar[i];
            ar[i] = temp;

            j = pivot;
            pivot = i;
        }
    }
}

// cs dojo's algo
int partition2(int ar[], int low, int high)
{
    int i = low - 1, c = 0, j, temp, pivot = high;

    while (c++ <= high - 1)
        if (ar[i] < ar[pivot])
            i++;

    j = i + 1;
    while (j < high)
    {
        if (ar[j] < ar[pivot])
        {
            temp = ar[++i];
            ar[i] = ar[j];
            ar[j] = temp;
        }
        j++;
    }
    temp = ar[++i];
    ar[i] = ar[pivot];
    ar[pivot] = temp;
    return i;
}

void quickSort(int ar[], int low, int high)
{
    if (low >= high)
        return;
    int pivot = partition(ar, low, high);
    quickSort(ar, low, pivot - 1);
    quickSort(ar, pivot + 1, high);
}

