int bin_search(int ar[],int size,int low,int up)
{
    int i,item;
    printf("Enter item to be searched : ");
    scanf("%d",&item);
    while(low<up)
    {
        int mid = (low+up)/2;
        if(item==ar[mid])
        {
            printf("\nFound\n");
            return 0;
        }
        else if(item<ar[mid])
            up=mid-1;
        else if(item>ar[mid])
            low=mid+1;
    }
    if(low>up)
        printf("\nNot Found\n");
    return 0;
}

