int partition(int ar[],int l,int u)
{
int i=l,j=u,pos=i,temp;
while(1)
{
    while(ar[pos]<=ar[j] && pos!=j)
    {
        j--;
    }
    if(pos==j)
    {
        return pos;
    }
    if(ar[pos]>ar[j])
    {
        temp=ar[pos];

        
        ar[pos]=ar[j];
        ar[j]=temp;
        pos=j;
    }
    while(ar[pos]>=ar[i] && pos!=i)
    {
        i++;
    }
    if(pos==i)
    {
        return pos;
    }
    if(ar[pos]<ar[i])
    {
        temp=ar[pos];
        ar[pos]=ar[i];
        ar[i]=temp;
        pos=i;
    }
}
}
