void osLabCalculationsXD(int a_t[],int b_t[],int p[],int n){
	int tt, wt, i, init=0, avgWT=0, avgTT=0;
	for(i=0; i<n; i++){
		wt = init-a_t[i];
		tt = wt+b_t[i];
		avgWT += wt;
		avgTT += tt;
		init += b_t[i];
	}
	avgWT /= n;
	avgTT /= n;
	printf("\nAvg. Waiting Time = %d\n",avgWT);
	printf("\nAvg. TurnAround Time = %d\n",avgTT);
}

