#define MAX_EDGES 100
struct Edge {
int src, dest, weight;
};
struct Graph {
int V, E;
struct Edge edges[MAX_EDGES];
};
struct Subset {
int parent;
int rank;
};
int find(struct Subset subsets[], int i) {
if (subsets[i].parent != i)

subsets[i].parent = find(subsets, subsets[i].parent);
return subsets[i].parent;
}
void unionSet(struct Subset subsets[], int x, int y) {
int xroot = find(subsets, x);
int yroot = find(subsets, y);
if (subsets[xroot].rank < subsets[yroot].rank)
subsets[xroot].parent = yroot;
else if (subsets[xroot].rank > subsets[yroot].rank)
subsets[yroot].parent = xroot;
else {
subsets[yroot].parent = xroot;
subsets[xroot].rank++;
}
}
int compare(const void* a, const void* b) {
struct Edge* edge1 = (struct Edge*)a;
struct Edge* edge2 = (struct Edge*)b;
return edge1->weight - edge2->weight;
}
void kruskal(struct Graph* graph) {
struct Subset* subsets = (struct Subset*)malloc(graph->V * sizeof(struct Subset));
struct Edge* result = (struct Edge*)malloc((graph->V - 1) * sizeof(struct Edge));
for (int i = 0; i < graph->V; i++) {
subsets[i].parent = i;
subsets[i].rank = 0;
}
qsort(graph->edges, graph->E, sizeof(graph->edges[0]), compare);
int i = 0, e = 0;
while (e < graph->V - 1) {
struct Edge nextEdge = graph->edges[i++];
int x = find(subsets, nextEdge.src);

int y = find(subsets, nextEdge.dest);
if (x != y) {
result[e++] = nextEdge;
unionSet(subsets, x, y);
}
}
printf("Minimum Cost Spanning Tree:\n");
for (i = 0; i < e; i++)
printf("%d - %d (%d)\n", result[i].src, result[i].dest, result[i].weight);
free(subsets);
free(result);
}
int main() {
struct Graph graph = { 4, 5, {
{ 0, 1, 10 },
{ 0, 2, 6 },
{ 0, 3, 5 },
{ 1, 3, 15 },
{ 2, 3, 4 }
} };
kruskal(&graph);
return 0;
}

