import java.util.Scanner;
public class Main {
 private int[] numbers = new int[10];
 private int sum = 0;
 public static void main(String[] args) {
 Main program = new Main();
 program.readNumbers();
 double average = program.computeAverage();
 int aboveAverageCount = program.countAboveAverage(average);
 System.out.println("Average: " + average);
 System.out.println("Count of numbers above the average: " + aboveAverageCount);
 }
 private void readNumbers() {
 Scanner scanner = new Scanner(System.in);
 for (int i = 0; i < this.numbers.length; i++) {
 System.out.print("Enter number " + (i + 1) + ": ");
 this.numbers[i] = scanner.nextInt();
 }
 }
 private double computeAverage() {
 for (int number : this.numbers) {
 this.sum += number;
 }
 return (double) this.sum / this.numbers.length;
 }
 private int countAboveAverage(double average) {
 int count = 0;
 for (int number : this.numbers) {
 if (number > average) {
 count++;
 }
 }
 return count;
 } }


