 for(i=0;i<n;i++)
    {
        pos=i;
        for(j=i+1;j<n;j++)
        {
            if(bt[j]<bt[pos])
                pos=j;
        }
        temp=bt[i];
        bt[i]=bt[pos];
        bt[pos]=temp;
 
        temp=p[i];
        p[i]=p[pos];
        p[pos]=temp;
    }
    wt[0]=0;
  for(i=1;i<n;i++){
        wt[i]=0;
        for(j=0;j<i;j++)
//individual WT by adding BT of all previous completed processes
        wt[i]+=bt[j];
        //total waiting time
        total+=wt[i];   
    }
    //average waiting time
    avg_wt=(float)total/n;  
printf("\nProcess\t Burst Time \tWaiting Time\tTurnaround Time");
