      printf("Arrival Time: ");
      scanf("%d",&AT[i]);
      printf("Execution Time: ");
      scanf("%d",&ET[i]);
      PID[i]=i+1;
    }
       //sorting for arrival time
     for(i=0;i< -1;i++){
      min=i;
      for(j=i+1;j< n;j++){
        if(AT[j]< AT[min]){
          min=j;
        } 
      }
      temp=AT[i];
      AT[i]=AT[min];
      AT[min]=temp;
      
      temp=ET[i];
      ET[i]=ET[min];
      ET[min]=temp;
      
      temp=PID[i];
      PID[i]=PID[min];
      PID[min]=temp;
    }
    for(i=0;i< n;i++){
      RT[i]=ET[i];
    }
    RT[n]=9999;
    j=0;
    for(min=0;j!=n;min++){
      temp=n;
      for(i=0;i< n;i++){
        if(AT[i]<=min && RT[i]< RT[temp] && RT[i]>0){
          temp=i;
        }
      }
      RT[temp]--;
      if(RT[temp]==0){
        j++;
        thrpt=min+1;
        CT[temp]=thrpt;
        if(maxCT< thrpt)
        {
          maxCT=thrpt;
        }
      }
    }
    printf("Process\tArrival Time\tExecution Time\tCompletion Time\tTAT\tWaiting Time\n");
