// Function to check if a given position is safe for the queen
bool isSafe(int board[][4], int row, int col) {
int i, j;
// Check the current row for any queens
for (i = 0; i < col; i++) {
if (board[row][i] == 1) {
return false;
}
}
// Check the upper diagonal for any queens
for (i = row, j = col; i >= 0 && j >= 0; i--, j--) {
if (board[i][j] == 1) {
return false;
}
}
// Check the lower diagonal for any queens
for (i = row, j = col; i < 4 && j >= 0; i++, j--) {
if (board[i][j] == 1) {
return false;
}
}
// The position is safe for the queen
return true;
}
