for (j = 0; j < 4; j++) {
printf("%d ", board[i][j]);
}
printf("\n");
}
printf("\n");
}
// Recursive function to place queens on the board
bool solveNQueens4x4(int board[][4], int col) {
// Base case: all queens are placed on the board
if (col == 4) {
// Print the solution board
printBoard(board);
return true;
}
bool res = false;
int i;
// Try placing a queen in each row of the current column
for (i = 0; i < 4; i++) {
// Check if the current position is safe for the queen
if (isSafe(board, i, col)) {
// Place the queen in the current position
board[i][col] = 1;
// Recursively call the function to place the remaining queens
res = solveNQueens4x4(board, col+1) || res;
// Backtrack and remove the queen from the current position
board[i][col] = 0;
}
}
return res;
}
