void compute_lps_array(char *pattern, int m, int *lps) { 
    int len = 0; // length of the previous longest prefix suffix int i; 
    lps[0] = 0; // lps[0] is always 0 
    int i = 1; 
    while (i < m) { 
        if (pattern[i] == pattern[len]) { 
            len++;
            lps[i] = len;
            i++; 
        }
        else { 
            if (len != 0) { 
                len = lps[len-1]; 
            } 
            else { 
                lps[i] = 0;
                i++; 
            } 
        } 
    } 
}
void kmp_search(char *text, char *pattern) { 
