      if (array[d] > array[d+1]) /* For decreasing order use '<' instead of '>' */
      {
        swap       = array[d];
        array[d]   = array[d+1];
        array[d+1] = swap;
      }
    }
  }

  printf("Sorted list in ascending order:\n");

  for (c = 0; c < n; c++)
     printf("%d\n", array[c]);

  return 0;
}

Time Complexity-
Worst Case:O(n^2)
Average Case:O(n^2)
Best Case:O(n)

/************************Radix Sort*****************************/

#include<stdio.h>
 

int getMax(int nums[], int n) {
    int max = nums[0];
    int i;
    for (i = 1; i < n; i++)
        if (nums[i] > max)
            max = nums[i];
    return max;
}

void CountSort(int nums[], int n, int exp) {
    
    int output[n];
    
  
    int i, cnt[10] = { 0 };
 
   
    for (i = 0; i < n; i++)
        cnt[(nums[i] / exp) % 10]++;
 
   
    for (i = 1; i < 10; i++)
        cnt[i] += cnt[i - 1];
 
    
    for (i = n - 1; i >= 0; i--) {
        output[cnt[(nums[i] / exp) % 10] - 1] = nums[i];
        cnt[(nums[i] / exp) % 10]--; 
    }
 
   
    for (i = 0; i < n; i++)
        nums[i] = output[i];
}


void RadixSort(int nums[], int n) {
    int m = getMax(nums, n);

    
    for (int exp = 1; m / exp > 0; exp *= 10)
        CountSort(nums, n, exp);
}
 

void print(int nums[], int n) {
    int i;
    for (i = 0; i < n; i++)
        printf("%d ", nums[i]);
}
 

int main() {

    printf("Enter number of elements: ");
    int N= 0;
    scanf("%d", &N);
    int nums[N];
    printf("Enter elements: ");
    for(int i=0; i<N; i++){
        scanf("%d", &nums[i]);
    }
    
    RadixSort(nums, N);
    
    
    printf("Sorted Array is: ");
    print(nums, N);
    return 0;
}

Time Complexity-
O(d * (n + k)). The worst case time complexity of Radix Sort is the same as the best and average cases. This is because the time complexity is primarily dependent on the number of digits (d), the number of elements (n), and the range of the input values (k), rather than the specific distribution of the input.


/*************************Heap Sort****************************/

#include <stdio.h>
  
  void swap(int *a, int *b) {
    int tempvar = *a;
    *a = *b;
    *b = tempvar;
  }
  
  void heapify(int arr[], int n, int i) {
    
    int greatest = i;
    int leftSide = 2 * i + 1;
    int rightSide = 2 * i + 2;
  
    if (leftSide < n && arr[leftSide] > arr[greatest])
      greatest = leftSide;
  
    if (rightSide < n && arr[rightSide] > arr[greatest])
      greatest = rightSide;
  
  
    if (greatest != i) {
      swap(&arr[i], &arr[greatest]);
      heapify(arr, n, greatest);
    }
  }

  void heapSort(int arr[], int n) {

    for (int i = n / 2 - 1; i >= 0; i--)
      heapify(arr, n, i);
  

    for (int i = n - 1; i >= 0; i--) {
      swap(&arr[0], &arr[i]);
  
      heapify(arr, i, 0);
    }
  }
  

  void printArray(int arr[], int n) {
    for (int i = 0; i < n; ++i)
      printf("%d ", arr[i]);
    printf("\n");
  }
  

  int main() {
    int arr[20],n,i;
    printf("How many numbers you want to sort:  ");
    scanf("%d", &n);
    printf("\nEnter %d numbers\t", n);
    printf("\n");
    for (i = 0; i < n; i++)
    scanf("%d", &arr[i]);
    
    printf("\nUnsorted array :\n ");
    for (i = 0; i < n; i++)
    printf("%d\t",arr[i]);
    
  
    heapSort(arr, n);
  
    printf("Sorted array is \n");
    printArray(arr, n);
  }

